def transform_time(input_data):
    output_data = []
    for time in input_data:
        hour = int(time[0][:2])
        if hour >= 12:
            period = 'PM'
            if hour > 12:
                hour -= 12
        else:
            period = 'AM'
            if hour == 0:
                hour = 12

        start_hour = str(hour).zfill(2) + ':00'
        end_hour = str((hour + 2) % 12).zfill(2) + ':00'
        if end_hour == '00:00':
            end_hour = '12:00'

        output_data.append([start_hour + period + '-' + end_hour + period])

    return output_data

