def transform_time(input_data):
    output_data = []
    for time in input_data:
        hour = int(time[0][:2])
        minute = int(time[0][3:5])

        if hour < 12:
            period = 'AM'
        else:
            period = 'PM'

        start_hour = hour
        start_minute = minute - (minute % 15)

        end_hour = hour
        end_minute = start_minute + 14

        if start_minute < 0:
            start_minute += 60
            start_hour -= 1

        if end_minute >= 60:
            end_minute -= 60
            end_hour += 1

        if start_hour == 0:
            start_hour = 12
        elif start_hour > 12:
            start_hour -= 12

        if end_hour == 0:
            end_hour = 12
        elif end_hour > 12:
            end_hour -= 12

        output_data.append([f'{start_hour:02d}:{start_minute:02d}{period}-{end_hour:02d}:{end_minute:02d}{period}'])

    return output_data

